-- Dumping structure for procedure database2135020.procedure_orders_select_all_with_optional_filters
DELIMITER //
CREATE PROCEDURE `procedure_orders_select_all_with_optional_filters`(
	IN `p_customers_id` CHAR(36),
	IN `p_customers_datetime_created` DATETIME
)
BEGIN

	#####################################################################################################################
	#REVISION HISTORY:
	#####################################################################################################################
	
	#DEVELOPER 												DATE 							COMMENTS
	
	#Julien Pontbriand (2135020) 						2022-11-23 					Created the procedure
	#Julien Pontbriand (2135020) 						2022-11-24 					Updated the procedure
	
	#####################################################################################################################<
	
	IF p_customers_id = '' AND p_customers_datetime_created = '' THEN
	
		SELECT * 
		FROM view_orders_detailed
		ORDER BY orderCreated DESC;
	
	ELSEIF p_customers_id = '' THEN
	
		SELECT *
		FROM view_orders_detailed
		WHERE orderCreated >= p_customers_datetime_created
		ORDER BY orderCreated DESC;
		
	ELSEIF p_customers_datetime_created = '' THEN
	
		SELECT *
		FROM view_orders_detailed
		WHERE customerId = p_customers_id
		ORDER BY orderCreated DESC;
	
	ELSE
	
		SELECT *
		FROM view_orders_detailed
		WHERE customerId = p_customers_id AND orderCreated >= p_customers_datetime_created
		ORDER BY orderCreated DESC;
	
	END IF;

END//
DELIMITER ;

